import { makeStyles } from "@material-ui/core";

const homePageStyles = makeStyles({
  root: {
    width: "90vw",
    height: "86vh",
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%,-50%)",
    overflow: "auto",
    borderRadius: 0,
  },
  tableBody: {
    "&:nth-child(even) tr:nth-child(odd)": {
      backgroundColor: "#F4EEFF",
    },
  },
  tableCell: {
    border: "none",
    padding: "10px",
  },
  tableCellHeader: {
    border: "none",
    padding: "16px 10px",
    fontSize: "1rem",
    fontWeight: 600,
  },
});

export default homePageStyles;
